  `Renta` int(11) NOT NULL,
  `NumNiveles` int(11) NOT NULL,
  `DirContacto` varchar(200) NOT NULL,
  `Email` varchar(75) NOT NULL,
  `Tel1` varchar(20) NOT NULL,
  `Tel2` varchar(20) NOT NULL,
  `Eq1` varchar(100) NOT NULL,
  `Eq2` varchar(100) NOT NULL,
  `Ayudado` varchar(100) NOT NULL,
  `Activo` varchar(6) DEFAULT NULL,
